description:
American Made (Alexis Ford / DvdRip / 2010)

Alexis Ford has brought her detailing crew to Tommy Gunn's mansion. She and three of her sexiest helpers are there to detail Tommy's fleet of classic cars. Tommy is smitten with Alexis but turns his sights to Nicole Ray for a quickie on the staircase. Alexis stops in to check on some paper work with Justine Joli. After a bit of conversation, they discover they both like girls! Later, Alexis checks on her crew while they are working on the cars. Nicole informs her that the very rich and cute Tommy Gunn has an eye on her.

Alexis Ford, Danni Cole, Evan Stone, Isis Taylor, Justine Joli, Kris Slater, Nicole Ray, Tommy Gunn

